import React from 'react';

const InsuranceSection: React.FC = () => {
  const whatsappLink = 'https://wa.me/SEU_NUMERO_DE_TELEFONE?text=Ol%C3%A1,%20gostaria%20de%20consultar%20os%20conv%C3%AAnios%20dispon%C3%ADveis.';
  const whatsappIconUrl = 'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6b/WhatsApp.svg/2048px-WhatsApp.svg.png'; // Exemplo de URL de ícone

  return (
    <section id="convenios" className="py-20">
      <div className="container mx-auto px-4">
        <h2 className="text-3xl font-bold text-center mb-12">Convênios</h2>
        <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-8">
          <div className="bg-white p-6 rounded-lg shadow-md flex items-center justify-center">
            <img src="/api/placeholder/150/80" alt="Convênio 1" />
          </div>
          <div className="bg-white p-6 rounded-lg shadow-md flex items-center justify-center">
            <img src="/api/placeholder/150/80" alt="Convênio 2" />
          </div>
          <div className="bg-white p-6 rounded-lg shadow-md flex items-center justify-center">
            <img src="/api/placeholder/150/80" alt="Convênio 3" />
          </div>
          <div className="bg-white p-6 rounded-lg shadow-md flex items-center justify-center">
            <a href={whatsappLink} target="_blank" rel="noopener noreferrer" className="flex items-center justify-center">
              <img src={whatsappIconUrl} alt="Consultar Convênios via WhatsApp" style={{ height: '40px', width: '40px' }} />
            </a>
          </div>
        </div>
      </div>
    </section>
  );
};

export default InsuranceSection;
